Amateur Photographer -  November 7th 2009
English | 100 pages | PDF

Amateur Photographer is the worlds oldest weekly magazine for photography enthusiasts. With its unique weekly format, it is the first for news and digital and film equipment tests. Regular features on reader portfolios, darkroom, digital, black &amp; white and photographer profiles ensure all areas of photography are covered.
